function rdLoading() {
	var e = {
		restrict : "AE",
		template : '<div class="loading"><div class="double-bounce1"></div><div class="double-bounce2"></div></div>'
	};
	return e
}
function rdWidgetBody() {
	var e = {
		requires : "^rdWidget",
		scope : {
			loading : "@?",
			classes : "@?"
		},
		transclude : !0,
		template : '<div class="widget-body" ng-class="classes"><rd-loading ng-show="loading"></rd-loading><div ng-hide="loading" class="widget-content" ng-transclude></div></div>',
		restrict : "E"
	};
	return e
}
function rdWidgetFooter() {
	var e = {
		requires : "^rdWidget",
		transclude : !0,
		template : '<div class="widget-footer" ng-transclude></div>',
		restrict : "E"
	};
	return e
}
function rdWidgetTitle() {
	var e = {
		requires : "^rdWidget",
		scope : {
			title : "@",
			icon : "@"
		},
		transclude : !0,
		template : '<div class="widget-header"><div class="row"><div class="pull-left"><i class="fa" ng-class="icon"></i> {{title}} </div><div class="pull-right col-xs-6 col-sm-4" ng-transclude></div></div></div>',
		restrict : "E"
	};
	return e
}
function rdWidget() {
	var e = {
		transclude : !0,
		template : '<div class="widget" ng-transclude></div>',
		restrict : "EA"
	};
	return e
}

function searchFor(){
	return function(arr, searchString){
		if(!searchString){
			return arr;
		}
		var result = [];
		searchString = searchString.toLowerCase();
		angular.forEach(arr, function(marker){
			if(marker.name.toLowerCase().indexOf(searchString) !== -1 || marker.id.toLowerCase().indexOf(searchString) !== -1 || marker.description.toLowerCase().indexOf(searchString) !== -1){
			result.push(marker);
		}
		});
		return result;
	};
}
function loginCtrl($scope, $state, $http) {
	var username = "";
	var password = "";
	$scope.loginform = function () {
		if (username == null || username == "" || password == null || password == ""){
			console.log("empty");
		}
		else {
			
			var hashpassword = md5(password);
			var method = 'POST';
			var url = 'http://test.ohai-app.com/Credential/validate.php';
			var data = {
				username: username,
				hashpassword: hashpassword
			};
			console.log(data);
			$http({
			  method: method,
			  url: url,
			  data: data,
			  headers: {'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8'},
			}).
			success(function(response) {
				if(response == "rejected"){
					window.alert("Authentication failed");
				}
				else{
					$scope.username = response[0].username;
					$scope.email = response[0].email;
					$scope.role = response[0].role;
					setService(true);
					console.log(getService());
					$state.go("private.admin.dashboard");
				}
			}).
			error(function(response) {
				console.log("error");
				$scope.codeStatus = response || "Request failed";
			});
		}
	}
	$scope.loginusername = function (ur) {
		username = ur;
		console.log(username);
	}
	$scope.loginpassword = function (pw) {
		password = pw;
		console.log(password);
	}
}
